import React, { Component } from "react";
import "./App.css";
class Navbar extends Component {
  state = {};
  render() {
    return (
      <div className="nav">
        <div className="logo">LOGO</div>
        <a href="#">
          {setInterval(() => {
            Date();
          }, 1000)}
        </a>
      </div>
    );
  }
}

export default Navbar;
